/* Depending on whether this key has an image or not (yet) hide or show appropriate fields */
/* and group boxes */

Local Record &Rec_X_PT3_IMG_WRK = GetLevel0()(1).GetRecord(Record.X_PT3_IMG_WRK);
Local Record &Rec_X_PT3_USR_IMAGE = GetLevel0()(1).GetRecord(Record.X_PT3_USR_IMAGE);

&Rec_X_PT3_IMG_WRK.GROUPBOX1.Visible = False;
&Rec_X_PT3_IMG_WRK.PB_MOVE_LEFT.Visible = False;

If All(&Rec_X_PT3_USR_IMAGE.X_PT3_EQUIP.Value) Then
   &Rec_X_PT3_IMG_WRK.HR_DUMMY_IMAGE.Visible = False;
   &Rec_X_PT3_USR_IMAGE.X_PT3_EQUIP.Visible = True;
   &Rec_X_PT3_USR_IMAGE.PSIMAGEVER.Visible = True;

   &Rec_X_PT3_IMG_WRK.DELETE_PB.Visible = True;
   &Rec_X_PT3_IMG_WRK.PT_IMG_CROP.Visible = True;
   &Rec_X_PT3_IMG_WRK.PT_IMG_RESIZE.Visible = True;


Else
   &Rec_X_PT3_IMG_WRK.HR_DUMMY_IMAGE.Value = Image.X_TRAIN_EQUIP_ICON;
   &Rec_X_PT3_IMG_WRK.HR_DUMMY_IMAGE.Visible = True;
   &Rec_X_PT3_USR_IMAGE.X_PT3_EQUIP.Visible = False;
   &Rec_X_PT3_USR_IMAGE.PSIMAGEVER.Visible = False;

   &Rec_X_PT3_IMG_WRK.DELETE_PB.Visible = False;
   &Rec_X_PT3_IMG_WRK.PT_IMG_CROP.Visible = False;
   &Rec_X_PT3_IMG_WRK.PT_IMG_RESIZE.Visible = False;

End-If;

/*********************************************************/
/** PeoopleTools Tech Tips     	        				**/
/** Randy Groncki 2021-05-12          	                **/
/** peopletoolstechtips@gmail.com                       **/
/** User Uploaded Images                                **/
/*********************************************************/
Local Record &Rec_X_PT3_IMG_WRK = GetLevel0()(1).GetRecord(Record.X_PT3_IMG_WRK);
Local Record &Rec_X_PT3_USR_IMAGE = GetLevel0()(1).GetRecord(Record.X_PT3_USR_IMAGE);

Local boolean &Bl_Image_Delete;

&Bl_Image_Delete = DeleteImage(X_PT3_USR_IMAGE.X_PT3_EQUIP);

If &Bl_Image_Delete Then
   /* success */
   &Rec_X_PT3_USR_IMAGE.PSIMAGEVER.Value = 0;
   MessageBox(0, "", 0, 0, "Image Deleted");
Else
   /* fail */
   MessageBox(0, "", 0, 0, "Error Deleting Imiage");
End-If;

/*********************************************************/
/** PeoopleTools Tech Tips     	        				**/
/** Randy Groncki 2021-05-12          	                **/
/** peopletoolstechtips@gmail.com                       **/
/** User Uploaded Images                                **/
/*********************************************************/
Local Record &Rec_X_PT3_IMG_WRK = GetLevel0()(1).GetRecord(Record.X_PT3_IMG_WRK);
Local Record &Rec_X_PT3_USR_IMAGE = GetLevel0()(1).GetRecord(Record.X_PT3_USR_IMAGE);

Local integer &Int_Image_Insert;

&Int_Image_Insert = InsertImage(X_PT3_USR_IMAGE.X_PT3_EQUIP);

Evaluate &Int_Image_Insert
When = %InsertImage_Success
   /* success */

   &Rec_X_PT3_USR_IMAGE.X_PT3_EQUIP.Visible = True;
   &Rec_X_PT3_USR_IMAGE.PSIMAGEVER.Visible = True;
   &Rec_X_PT3_IMG_WRK.HR_DUMMY_IMAGE.Visible = False;

   &Rec_X_PT3_IMG_WRK.DELETE_PB.Visible = True;
   &Rec_X_PT3_IMG_WRK.PT_IMG_CROP.Visible = True;
   &Rec_X_PT3_IMG_WRK.PT_IMG_RESIZE.Visible = True;
   Break;

When = %InsertImage_Cancelled
   MessageBox(0, "", 0, 0, "User Canceled Image Upload");
   Break;

When = %InsertImage_ExceedsMaxSize
   MessageBox(0, "", 0, 0, "Image Exceeded Max Size");
   Break;

When-Other
   MessageBox(0, "", 0, 0, "Virus Scan Issue");
End-Evaluate;

